import toto from "./images/maison1.jpg"

function Pictures({ pictures }) {
    console.log(pictures)
    return (
        <div>
            

                {
                    pictures.map((picture) => {
                        let image = require("./images/maison1.jpg")
                        return (
                            <div className="images" key={picture.name}>
                                img src={image} alt="Maison 1" />
                            </div>
                        )
                    })
                }
            


        </div>
    )
}

export default Pictures;
